const getLines = () => {
    return fetch('https://api.staging.entur.io/journey-planner/v2/graphql', {
        method: 'POST',
        headers: {
            'Content-type': 'application/json',
        },
        body: JSON.stringify({ query: 'query{ lines(authorities: GOA:Authority:GOA) { id name quays { id name } } }' }),
    })
        .catch(error => error)
        .then(response => response.json())
        .then(data => {
            localStorage.setItem('lines', JSON.stringify(data));
        });
};

export default{ getLines }
